import './App.css'
import {useState, useEffect} from 'react'
import Cart from './components/pages/Cart'
import Catalog from './components/pages/Catalog'
import Tabs from './components/elements/Tabs'
import ProductInfo from './components/pages/ProductInfo'
import {Link, Routes, Route} from "react-router-dom"

function App() {

  const [records, setRecords] = useState([])
  const baseUrl = "https://api.airtable.com/v0/appduyTcvGxpEgTb8/tblMpliaVkCLsiKnC?view=%D0%92+%D0%BD%D0%B0%D0%BB%D0%B8%D1%87%D0%B8%D0%B8"

    useEffect(() => {
        fetch(baseUrl, {
            headers: {
                'Authorization': 'Bearer keymV3iplyx82ryEd'
            }
        })
            .then(res => res.json())
            .then(data => setRecords(data.records))
    }, [])

  return (
    <div className="App">
      <Routes>
        <Route exact path="/" element={<Catalog records={records}/>} />
        <Route path="/cart" element={<Cart />} />
        <Route path="/product_info" element={<ProductInfo />} />
      </Routes>
      <Tabs />
    </div>
  );
}

export default App;
